const axios = require('axios');

const getUsersById = (handleSuccess, email, passwod) => {
    axios.post(`http://localhost:8000/login`)
    .then(success => {
        handleSuccess(success.data)
    }).catch(error => console.log(error))
}

export {getUsersById};
